import fetch from 'isomorphic-fetch'

export function postContact (body) {
    console.log('body: ', JSON.stringify(body), body);

    return fetch("http://localhost:3000/test/api/auth/contact", {
        method: 'POST',
        headers: {
            'Accept':'application/json',
            'content-type': 'application/x-www-form-urlencoded; charset=utf-8',
        },
        // mode: 'no-cors',
        body: JSON.stringify(body)
        // headers: {
        //     'Accept': 'application/json',
        //     // 'content-type': 'application/x-www-form-urlencoded; charset=utf-8',
        // },
        // body: JSON.stringify({body})
    }).then(function (response) {
        // if (response.status != 200) {
        //     dispatch(setError(response.status + '===>' + response.statusText + '===>' + response.url))
        // }
        console.log('test: hier is he tnu');
        return JSON.stringify(response);
    })
    .then(function (json) {
        console.log('test', JSON.stringify(json));

        // dispatch(setData(json, q))
    }).catch(function(err){
        console.log(err);
    });
}
